import React from 'react'
import '../css-components/navbar.css';

const Navbar = () => {
  return (
    <nav id='navus'>
        <div className='container-fluid'>
            <a className='navbar-brand' href='./components/home.jsx'>Banana Shop</a>
            <button className='navbar-toggler'><span className="navbar-toggler-icon"></span></button>
        </div>
        <div>
            <ul id='navi'>
                <li><a href='./components/tienda.jsx'>Store</a></li>
                <li><a href='./components/login.jsx'>Login</a></li>
                <li><a href='./components/products.jsx'>Products</a></li>
            </ul>
        </div>
    </nav>
  )
}
export default Navbar;
